import "./About.css";
import Navbar from "./Navbar";

export default function About() {
  return (
    <div className="About">
      <Navbar />
      Hi, I’m Annika. I’m a junior full stack web developer based in Berlin,
      with a passion for art and technology. I believe in technology as a tool
      for collaboration, self expression, democracy, and accessibility.
      <br />I hold a certificate in Full Stack Web Development from Wild Code
      School Berlin, and a Master’s Degree in Art History from the University of
      British Columbia. I have over 7 years of experience working in the
      creative field, and am proficient in HTML, CSS, JavaScript, React, the
      Adobe Creative Suite, and Figma. On the back end, I have experience with
      Express, Node.js, MySQL, and PostgreSQL.
    </div>
  );
}
